<h2 id="formitemconfig" tabindex="-1"><a class="header-anchor" href="#formitemconfig" aria-hidden="true">#</a> formItemConfig</h2>
<p>表单项的单独配置</p>
<table>
<thead>
<tr>
<th>属性</th>
<th>说明</th>
<th>类型</th>
<th>可选值</th>
<th>默认值</th>
</tr>
</thead>
<tbody>
<tr>
<td>prop</td>
<td>表单域 model 字段， 在使用 validate、resetFields 方法的情况下，该属性是必填的</td>
