<td>传入 Form 组件的 model 中的字段</td>
<td></td>
</tr>
<tr>
<td>label</td>
<td>标签</td>
<td>string</td>
<td>—</td>
<td>—</td>
</tr>
<tr>
<td>type</td>
<td>表单域组件，必填</td>
<td>string</td>
<td>input / radio / number / rate / select / switch / cascader / checkbox / timePicker</td>
<td>—</td>
</tr>
<tr>
<td>attr</td>
<td>表单项的原生内容,<a href="#attr">参考文档</a></td>
<td>object</td>
<td>—</td>
<td>—</td>
</tr>
<tr>
<td>labelWidth</td>
